// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract TokenContract is ERC20, Pausable, Ownable {
    using SafeMath for uint256;
    uint256 private _totalSupply;

    mapping(address => uint256) private _balanceOf;
    mapping(address => mapping(address => uint256)) private _allowance;

    constructor(uint256 initialSupply) ERC20("NRB Token", "NRB") {
        _totalSupply = initialSupply;
        _balanceOf[msg.sender] = initialSupply;
        _mint(msg.sender, initialSupply);
    }

    function transfer(address _to, uint256 _value) public whenNotPaused override returns (bool success) {
        require(_to != address(0), "Invalid address");
        require(_balanceOf[msg.sender] >= _value, "Insufficient balance");
        _balanceOf[msg.sender] = _balanceOf[msg.sender] - _value;
        _balanceOf[_to] = _balanceOf[_to] + _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balanceOf[account];
    }

    function approve(address _spender, uint256 _value) public whenNotPaused override returns (bool success) {
        require(_spender != address(0), "Invalid address");
        _allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner, address _spender) public view override returns (uint256) {
        return _allowance[_owner][_spender];
    }

    function increaseAllowance(address _spender, uint256 _addedValue) public whenNotPaused override returns (bool success) {
        require(_spender != address(0), "Invalid address");
        _allowance[msg.sender][_spender] = _allowance[msg.sender][_spender] + _addedValue;
        emit Approval(msg.sender, _spender, _allowance[msg.sender][_spender]);
        return true;
    }

    function decreaseAllowance(address _spender, uint256 _subtractedValue) public whenNotPaused override returns (bool success) {
        require(_spender != address(0), "Invalid address");
        uint256 oldValue = _allowance[msg.sender][_spender];
        if (_subtractedValue >= oldValue) {
            _allowance[msg.sender][_spender] = 0;
        } else {
            _allowance[msg.sender][_spender] = oldValue - _subtractedValue;
        }
        emit Approval(msg.sender, _spender, _allowance[msg.sender][_spender]);
        return true;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function mint(address _to, uint256 _value) public onlyOwner returns (bool success) {
        require(_to != address(0), "Invalid address");
        _totalSupply = _totalSupply.add(_value);
        _balanceOf[_to] = _balanceOf[_to].add(_value);
        emit Transfer(address(0), _to, _value);
        return true;
    }

   function burn(uint256 _value) public returns (bool success) {
        require(_balanceOf[msg.sender] >= _value, "Insufficient balance");
        _balanceOf[msg.sender] = _balanceOf[msg.sender].sub(_value);
        _totalSupply = _totalSupply.sub(_value);
        emit Transfer(msg.sender, address(0), _value);
        return true;
    }

    function burnFrom(address _from, uint256 _value) public returns (bool success) {
    require(_value <= _balanceOf[_from], "Insufficient balance");
    require(_value <= _allowance[_from][msg.sender], "Insufficient allowance");
    _balanceOf[_from] = _balanceOf[_from].sub(_value);
    _totalSupply = _totalSupply.sub(_value);
    _allowance[_from][msg.sender] = _allowance[_from][msg.sender].sub(_value);
    emit Transfer(_from, address(0), _value);
    return true;
    }
}
